import React from 'react';
import classes from './NavContentSetting.module.css'
import {useSelector,useDispatch} from 'react-redux';
import {navSettingsStatus} from '../../store/navBarReducer'
import InputSetting from '../../UI/InputSetting/InputSetting';
import FormSetting from '../FormSetting/FormSetting'

const NavContentSetting = () => {
  const dispatch= useDispatch()
  const navSettings=useSelector((state)=>state.navStatus)

  return (
    <div className={navSettings.settingStatus?`${classes.navContent_wrapper_active}`:`${classes.navContent_wrapper}`}>

      <div className={classes.setting_wrapper}>

        <div className={classes.timer_setting}>
          <FormSetting tittle={'Время работы'}/>
        </div>

      </div>
    </div>

  );
};

export default NavContentSetting;
